const SansitaRegular = `@font-face { font-family: 'Sansita'; font-style: normal; font-weight: 400; src: local('Sansita Regular'), local('Sansita-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const Sansita700 = `@font-face { font-family: 'Sansita'; font-style: normal; font-weight: 700; src: local('Sansita Bold'), local('Sansita-Bold'), url('data:font/woff2;base64,') format('woff2'); }`;
const SansitaItalic = `@font-face { font-family: 'Sansita'; font-style: italic; font-weight: 400; src: local('Sansita Italic'), local('Sansita-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Sansita700italic = `@font-face { font-family: 'Sansita'; font-style: italic; font-weight: 700; src: local('Sansita Bold Italic'), local('Sansita-BoldItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Sansita800 = `@font-face { font-family: 'Sansita'; font-style: normal; font-weight: 800; src: local('Sansita ExtraBold'), local('Sansita-ExtraBold'), url('data:font/woff2;base64,') format('woff2'); }`;
const Sansita800italic = `@font-face { font-family: 'Sansita'; font-style: italic; font-weight: 800; src: local('Sansita ExtraBold Italic'), local('Sansita-ExtraBoldItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Sansita900 = `@font-face { font-family: 'Sansita'; font-style: normal; font-weight: 900; src: local('Sansita Black'), local('Sansita-Black'), url('data:font/woff2;base64,') format('woff2'); }`;
const Sansita900italic = `@font-face { font-family: 'Sansita'; font-style: italic; font-weight: 900; src: local('Sansita Black Italic'), local('Sansita-BlackItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
